comment:
I have been on Effexor XR, 150 mg. for 9 years and find it very helpful as a depression aid. I had to give up my job in L.A. and move to Las Vegas when my husband was transferred in 2000; this was a monumental step for me, causing great headaches and depression. 
Once when I went on a five-day cruise, I forgot to take this medication and experienced withdrawal involving nausea and stomach aches; 
					...

while this drug works I found the side effects to be to hard to handle.  the brain zaps were crazy.  trouble going to the washroom, numbed most areas which was great for pain but horrible for any adult social interaction ;) 

read up on it as it has a reputation,  but as I said it works and is cheap its the bottom rung in this class  it goes effezr, cymbalta, pristq.  the last one being the best
					...
